    "sourceText": "export const StepperMotor28byj48 = ({\n  bodyDiameter = 28,\n  bodyHeight = 19,\n  bodyPlay = 0.1,\n  totalDiameter = 42,\n  tabDiameter = 7,\n  holeDiameter = 4,\n  shaftDiameter = 5,\n  shaftFlats = 3,\n  shaftOffset = 6,\n  shaftBaseDiameter = 9,\n  shaftBaseHeight = 2,\n  shaftLength = 10,\n  shaftPlay = 0.2,\n  connectorWidth = 15,\n  connectorLength = 7,\n  connectorBaseWidth = 17,\n  connectorBaseHeight = 4,\n  connectorHeight = 5,\n} = {}) =>\n  Group(\n    Arc(bodyDiameter)\n      .add(Box(connectorLength, connectorWidth).x(bodyDiameter / -2))\n      .add(\n        Box(connectorBaseHeight, connectorBaseWidth).x(bodyDiameter / -2 + 2)\n      )\n      .ez(-bodyHeight)\n      .mask(grow(bodyPlay)),\n    Group(\n      Arc(shaftBaseDiameter).ez(0, -shaftBaseHeight),\n      FlatShaft({\n        diameter: shaftDiameter,\n        length: shaftLength,\n        flatLength: shaftFlatsLength,\n        flatThickness: shaftFlats,\n        play: 0.2,\n      })\n    )\n      .x(bodyDiameter / 2 - shaftOffset)\n      .z(shaftBaseHeight),\n    Arc(tabDiameter)\n      .y(totalDiameter / 2 - tabDiameter / 2)\n      .rz(0, 1 / 2)\n      .hull(noOp())\n      .ez(-tabThickness)\n      .fitTo(\n        Arc(holeDiameter)\n          .ez(-tabThickness)\n          .void()\n          .as('hole')\n          .y(totalDiameter / 2 - tabDiameter / 2)\n          .rz(0, 1 / 2)\n      )\n  ).as('28byj48');",
    "sourceLocation": {
      "path": "nb/projects/pentacular/28BYJ-48/28BYJ-48.nb",
      "id": "StepperMotor28byj48"
    }
  },

    const prepareViews = async (notebook) => {
      // Prepare the view urls in the browser.
      for (const note of notebook) {
        if (note.view && !note.url) {
          note.url = await dataUrl(Shape.fromGeometry(note.data), note.view);
        }
      }
      return notebook;
    }

    const run = async () => {
      const body = document.getElementsByTagName('body')[0];
      const bookElement = document.createElement('div');
      const notebookElement = await toDomElement(await prepareViews(notebook));
      bookElement.appendChild(notebookElement);
      body.appendChild(bookElement);
      bookElement.classList.add('book', 'notebook', 'loaded');
    };

    if (document.readyState === 'complete') {
      run();
    } else {
      document.onreadystatechange = () => {
        if (document.readyState === 'complete') {
          run();
        }
      };
    }
  </script>
